import { React, useState } from "react";
import { useNavigate, Route, Routes, BrowserRouter } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import axios, { Axios } from "axios";

import SideBar from "./components/sidebar/SideBar";
import NavBar from "./components/content/Navbar";
import Allprojects from "./components/AllProjects.jsx";
import Addproject from "./components/Add.jsx";
import Updateproject from "./components/UpdateProject.js";
import SignUp from "./components/SingUp";
import Login from "./components/Login";
import OneProject from "./components/OneProject.jsx";
import Myprojects from "./components/Myprojects";
import Profile from "./components/Profil";
import UpdateProfile from "./components/UpdateProfile";

function App() {
  const navigate = useNavigate();
  const [userdata,setuserdata]=useState({})
  const userin=(obj)=>{
    setuserdata(obj)
  }
  return (
    <BrowserRouter className="App wrapper">
      <NavBar/>
      <Routes>
        <Route path="/" elemenet={<Login userin={userin}/>} />
        <Route path="/singup" elemenet={<SignUp />} />
        <Route path="/allproject" elemenet={<><Allprojects />   </>}/>
        <Route path="allproject/oneproject" elemenet={<><OneProject />  <NavBar />  <SideBar /></>} />
        <Route path="/myprojects" elemenet={<><Myprojects userdata={userdata}/>  <NavBar />  <SideBar /></>} />
        <Route path="/myprojects/addproject" elemenet={<><Addproject />  <NavBar />  <SideBar /></>} />
        <Route path="/myprojects/updateproject" elemenet={<><Updateproject />  <NavBar />  <SideBar /></>} />
        <Route path="/profile" elemenet={<><Profile userdata={userdata}/>  <NavBar />  <SideBar /> </>}/>
        <Route path="/profile/updateprofile" elemenet={<><UpdateProfile />  <NavBar />  <SideBar /></>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
